// ==UserScript==
// @name         Doing nothingは良くない
// @namespace    http://tampermonkey.net/
// @version      2.9.1
// @description  Loop a Base64 WAV sound when 'Doing nothing' appears in the window title in Milky Way Idle, send Ntfy notification.
// @author       Osyaburiman
// @match        https://www.milkywayidle.com/*
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_xmlhttpRequest
// @connect      ntfy.sh
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/533517/Doing%20nothing%E3%81%AF%E8%89%AF%E3%81%8F%E3%81%AA%E3%81%84.user.js
// @updateURL https://update.greasyfork.org/scripts/533517/Doing%20nothing%E3%81%AF%E8%89%AF%E3%81%8F%E3%81%AA%E3%81%84.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // 検出したい文字列
    const targetText = 'Doing nothing';
    // 検知してから何ミリ秒後に動作させるか
    const detectionDuration = 2000;

    // Base64エンコードされたWAVファイル（短いループ用WAVを推奨）
    const base64Sound = 'data:audio/wav;base64,'; // ダミーデータ、実際のBase64に置き換え

    // Ntfyトピック（初期値はランダム）
    let ntfyTopic = GM_getValue('ntfyTopic', 'milkywayidle_' + Math.random().toString(36).substr(2, 8));
    let notificationMode = GM_getValue('notificationMode', 'once'); // 'once' または 'interval'
    let notificationInterval = GM_getValue('notificationInterval', 5); // 分単位、デフォルト5分
    let isNtfyEnabled = GM_getValue('isNtfyEnabled', false); // 通知有効/無効、デフォルト無効

    // 通知モード選択UI（横並び、Steam対応）
    function addNotificationModeUI() {
        console.log('UI生成を開始します...');
        console.log('現在のdocument.body:', document.body ? '存在' : 'なし');
        console.log('現在のcanvas要素:', document.querySelector('canvas') ? '存在' : 'なし');

        // 既存のUIを削除
        const existingContainer = document.getElementById('ntfySettingsContainer');
        if (existingContainer) {
            existingContainer.remove();
            console.log('既存のUIを削除しました。');
        }

        // メインコンテナ（縦並び：トップ行＋ヘルプ）
        const container = document.createElement('div');
        container.id = 'ntfySettingsContainer';
        container.style.position = 'absolute';
        container.style.top = '4px';
        container.style.left = '4px';
        container.style.zIndex = '999999';
        container.style.backgroundColor = 'rgba(0, 0, 0, 0.7)';
        container.style.padding = '4px';
        container.style.borderRadius = '2px';
        container.style.color = '#fff';
        container.style.fontSize = '5px';
        container.style.display = 'flex';
        container.style.flexDirection = 'column';
        container.style.gap = '2px';
        container.style.pointerEvents = 'auto';
        container.style.opacity = '1';

        // トップ行コンテナ（チェックボックス＋ボタン行、横並び）
        const topRow = document.createElement('div');
        topRow.style.display = 'flex';
        topRow.style.flexDirection = 'row';
        topRow.style.alignItems = 'center';
        topRow.style.gap = '4px';

        // チェックボックス
        const checkboxLabel = document.createElement('label');
        checkboxLabel.style.display = 'flex';
        checkboxLabel.style.alignItems = 'center';
        checkboxLabel.style.cursor = 'pointer';
        checkboxLabel.style.padding = '2px 4px';
        checkboxLabel.style.backgroundColor = '#28a745';
        checkboxLabel.style.borderRadius = '1px';
        const checkbox = document.createElement('input');
        checkbox.type = 'checkbox';
        checkbox.checked = isNtfyEnabled;
        checkbox.style.marginRight = '2px';
        checkbox.addEventListener('change', () => {
            isNtfyEnabled = checkbox.checked;
            GM_setValue('isNtfyEnabled', isNtfyEnabled);
            console.log('Ntfy通知を' + (isNtfyEnabled ? '有効化' : '無効化') + 'しました');
            // UIの表示/非表示を切り替え
            buttonRow.style.display = isNtfyEnabled ? 'flex' : 'none';
            helpText.style.display = isNtfyEnabled && helpText.style.display === 'block' ? 'block' : 'none';
        });
        const checkboxText = document.createElement('span');
        checkboxText.textContent = 'Doing nothingスマホ通知';
        checkboxText.style.fontSize = '13px';
        checkboxLabel.appendChild(checkbox);
        checkboxLabel.appendChild(checkboxText);

        // ボタン行コンテナ（横並び）
        const buttonRow = document.createElement('div');
        buttonRow.style.display = isNtfyEnabled ? 'flex' : 'none'; // 初期表示はチェックボックス状態に依存
        buttonRow.style.flexDirection = 'row';
        buttonRow.style.alignItems = 'center';
        buttonRow.style.gap = '2px';

        // ヘルプボタン（トグルで説明を表示）
        const helpButton = document.createElement('button');
        helpButton.textContent = 'ヘルプ';
        helpButton.style.padding = '2px 4px';
        helpButton.style.backgroundColor = '#28a745';
        helpButton.style.color = '#fff';
        helpButton.style.border = 'none';
        helpButton.style.borderRadius = '1px';
        helpButton.style.cursor = 'pointer';
        helpButton.style.opacity = '0.8';
        helpButton.addEventListener('mouseover', () => {
            helpButton.style.opacity = '1';
        });
        helpButton.addEventListener('mouseout', () => {
            helpButton.style.opacity = '0.8';
        });
        helpButton.addEventListener('click', () => {
            helpText.style.display = helpText.style.display === 'none' ? 'block' : 'none';
        });

        // トピック入力欄
        const topicInput = document.createElement('input');
        topicInput.type = 'text';
        topicInput.placeholder = ntfyTopic;
        topicInput.value = '';
        topicInput.style.padding = '2px';
        topicInput.style.width = '150px';
        topicInput.style.backgroundColor = '#007bff';
        topicInput.style.color = '#fff';
        topicInput.style.border = 'none';
        topicInput.style.borderRadius = '1px';

        // トピック保存ボタン
        const saveTopicButton = document.createElement('button');
        saveTopicButton.textContent = 'トピック名保存';
        saveTopicButton.style.padding = '2px 4px';
        saveTopicButton.style.backgroundColor = '#007bff';
        saveTopicButton.style.color = '#fff';
        saveTopicButton.style.border = 'none';
        saveTopicButton.style.borderRadius = '1px';
        saveTopicButton.style.cursor = 'pointer';
        saveTopicButton.style.opacity = '0.8';
        saveTopicButton.addEventListener('mouseover', () => {
            saveTopicButton.style.opacity = '1';
        });
        saveTopicButton.addEventListener('mouseout', () => {
            saveTopicButton.style.opacity = '0.8';
        });
        saveTopicButton.addEventListener('click', () => {
            const newTopic = topicInput.value.trim();
            if (newTopic) {
                GM_setValue('ntfyTopic', newTopic);
                ntfyTopic = newTopic;
                console.log('Ntfyトピックを保存しました: ' + ntfyTopic);
                topicInput.placeholder = ntfyTopic;
                topicInput.value = '';
            } else {
                console.warn('トピックが空です。デフォルトトピックを使用します: ' + ntfyTopic);
            }
        });

        // 通知モード選択ドロップダウン
        const modeSelect = document.createElement('select');
        modeSelect.style.padding = '2px';
        modeSelect.style.backgroundColor = '#007bff';
        modeSelect.style.color = '#fff';
        modeSelect.style.border = 'none';
        modeSelect.style.borderRadius = '1px';
        const onceOption = document.createElement('option');
        onceOption.value = 'once';
        onceOption.textContent = '一度のみ';
        const intervalOption = document.createElement('option');
        intervalOption.value = 'interval';
        intervalOption.textContent = '〇分間隔で通知';
        modeSelect.appendChild(onceOption);
        modeSelect.appendChild(intervalOption);
        modeSelect.value = notificationMode;
        modeSelect.addEventListener('change', () => {
            GM_setValue('notificationMode', modeSelect.value);
            notificationMode = modeSelect.value; // 修正：poundedを削除
            console.log('通知モードを変更: ' + modeSelect.value);
            if (modeSelect.value === 'interval') {
                intervalInput.style.display = 'inline-block';
            } else {
                intervalInput.style.display = 'none';
            }
        });

        // 通知間隔入力
        const intervalInput = document.createElement('input');
        intervalInput.type = 'number';
        intervalInput.min = '1';
        intervalInput.value = notificationInterval;
        intervalInput.style.padding = '2px';
        intervalInput.style.width = '35px';
        intervalInput.style.backgroundColor = '#007bff';
        intervalInput.style.color = '#fff';
        intervalInput.style.border = 'none';
        intervalInput.style.borderRadius = '1px';
        intervalInput.style.display = notificationMode === 'interval' ? 'inline-block' : 'none';
        intervalInput.addEventListener('change', () => {
            const newInterval = parseInt(intervalInput.value, 10);
            if (newInterval >= 1) {
                GM_setValue('notificationInterval', newInterval);
                notificationInterval = newInterval;
                console.log('通知間隔を変更: ' + newInterval + '分');
            } else {
                intervalInput.value = notificationInterval;
                console.warn('1分以上の値を入力してください。');
            }
        });

        // ヘルプテキスト（初期非表示、文字サイズ16px、改行対応）
        const helpText = document.createElement('div');
        helpText.style.display = 'none';
        helpText.style.backgroundColor = 'rgba(0, 0, 0, 0.9)';
        helpText.style.padding = '4px';
        helpText.style.borderRadius = '2px';
        helpText.style.marginTop = '2px';
        helpText.style.maxWidth = '650px';
        helpText.style.fontSize = '16px';
        helpText.style.lineHeight = '1.5';
        const helpContent =
            '「Doing nothingは良くない」アプデによりスマホ通知機能追加！！！\n' +
            '\n' +
            '設定方法\n' +
            '①右の入力欄に好きなトピック名（例: syabusyabuyokunai）を命名し「トピック名保存」をクリック。\n' +
            '※トピック名はスマホに通知を送る際の暗号となるので、他の誰とも被らないように設定。（いつでも変更可能）\n' +
            '②スマホのストアから「Ntfy」アプリをインストール。（無料）\n' +
            '③Ntfyアプリで「+」ボタンをタップ、「Topic name（トピック名）」に命名したトピック名を入力し「Subscribe（購読）」を押す。（無料）\n' +
            '④通知モードを選択（Doing nothingになったら「一度のみ」通知、またはDoing nothingが継続している場合「〇分間隔で通知」）。\n' +
            '⑤完了！';
        helpText.innerHTML = helpContent.replace(/\n/g, '<br>'); // \n を <br> に置換

        // ボタン行に要素を追加
        buttonRow.appendChild(helpButton);
        buttonRow.appendChild(topicInput);
        buttonRow.appendChild(saveTopicButton);
        buttonRow.appendChild(modeSelect);
        buttonRow.appendChild(intervalInput);

        // トップ行にチェックボックスとボタン行を追加
        topRow.appendChild(checkboxLabel);
        topRow.appendChild(buttonRow);

        // メインコンテナに追加
        container.appendChild(topRow);
        container.appendChild(helpText);

        // ページにコンテナを追加
        try {
            // キャンバス要素を優先的にターゲット
            const canvas = document.querySelector('canvas');
            if (canvas && canvas.parentNode) {
                canvas.parentNode.appendChild(container);
                console.log('UIをcanvasの親要素に追加しました。');
            } else if (document.body) {
                document.body.appendChild(container);
                console.log('UIをdocument.bodyに追加しました。');
            } else {
                document.documentElement.appendChild(container);
                console.log('UIをdocument.documentElementに追加しました。');
            }
        } catch (error) {
            console.error('UI追加エラー:', error);
        }
    }

    // 手動UI表示関数（コンソール用）
    window.showUI = function() {
        console.log('手動でUI表示を試みます...');
        addNotificationModeUI();
    };

    // Audioオブジェクトをグローバルに保持
    let audio = null;
    let isPlaying = false;
    let notificationSent = false; // 一度のみモードでの通知フラグ
    let detectionStartTime = null; // 検知開始時刻
    let lastNotificationTime = null; // 最後の通知時刻

    // ウィンドウタイトルをチェック
    function checkForText() {
        const title = document.title;
        const textPresent = title.includes(targetText);

        if (textPresent) {
            // 「Doing nothing」が検知された
            if (!detectionStartTime) {
                // 初回検知：時刻を記録
                detectionStartTime = Date.now();
                console.log('「Doing nothing」検知開始');
            }

            // 2秒間継続しているかチェック
            if (Date.now() - detectionStartTime >= detectionDuration) {
                // 2秒経過：アクション実行
                if (!isPlaying) {
                    playSound();
                    console.log('「Doing nothing」が2秒間継続。');
                }

                // 通知送信チェック（チェックボックスがオンの場合のみ）
                if (isNtfyEnabled && shouldSendNotification() && ntfyTopic) {
                    sendNtfyNotification();
                    lastNotificationTime = Date.now();
                    if (notificationMode === 'once') {
                        notificationSent = true;
                    }
                    console.log('通知送信: モード=' + notificationMode + ', 間隔=' + notificationInterval + '分');
                }
            }
        } else {
            // 「Doing nothing」が消えた：リセット
            if (detectionStartTime) {
                detectionStartTime = null;
                console.log('「Doing nothing」検知中断');
            }
            if (isPlaying) {
                stopSound();
                notificationSent = false; // 一度のみモードで再通知可能に
                lastNotificationTime = null; // 間隔モードでタイマーリセット
                console.log('「Doing nothing」が消滅。アクション停止');
            }
        }
    }

    // 通知を送信すべきか判定
    function shouldSendNotification() {
        if (notificationMode === 'once') {
            return !notificationSent;
        } else if (notificationMode === 'interval') {
            if (!lastNotificationTime) {
                return true; // 初回通知
            }
            const minutesSinceLast = (Date.now() - lastNotificationTime) / 1000 / 60;
            return minutesSinceLast >= notificationInterval;
        }
        return false;
    }

    // 効果音をループ再生
    function playSound() {
        if (!audio) {
            audio = new Audio(base64Sound);
            audio.loop = true;
            audio.volume = 0.5;
        }
        audio.play().then(() => {
            isPlaying = true;
            console.log('効果音再生開始');
        }).catch(error => {
            console.error('音声再生エラー:', error);
        });
    }

    // 効果音を停止
    function stopSound() {
        if (audio) {
            audio.pause();
            audio.currentTime = 0;
            isPlaying = false;
            console.log('効果音停止');
        }
    }

    // Ntfyに通知を送信
    function sendNtfyNotification() {
        GM_xmlhttpRequest({
            method: 'POST',
            url: `https://ntfy.sh/${ntfyTopic}`,
            data: '良くないねぇ！！',
            headers: {
                'Content-Type': 'text/plain'
            },
            onload: response => {
                if (response.status === 200) {
                    console.log('Ntfy通知送信成功');
                } else {
                    console.error('Ntfy通知送信失敗:', response.responseText);
                }
            },
            onerror: error => {
                console.error('Ntfy通知エラー:', error);
            }
        });
    }

    console.log('トピックをリセットするには、コンソールで「GM_setValue(\'ntfyTopic\', \'\')」を実行し、再度トピックを入力してください。');
    console.log('UIを手動で表示するには、コンソールで `showUI()` を実行してください。');
    console.log('現在のウィンドウタイトル:', document.title);
    console.log('現在のNtfyトピック:', ntfyTopic);
    console.log('Ntfy通知状態:', isNtfyEnabled ? '有効' : '無効');

    // UIを遅延実行で追加
    function tryAddUI(attempts = 10, delay = 3000) {
        if (attempts <= 0) {
            console.error('UIの追加に失敗しました。ゲームのDOMが利用できません。コンソールで `showUI()` を試してください。');
            return;
        }
        const canvas = document.querySelector('canvas');
        if (document.body || canvas) {
            addNotificationModeUI();
        } else {
            console.warn(`DOMがまだ利用できません。${delay}ms後に再試行（残り${attempts}回）`);
            setTimeout(() => tryAddUI(attempts - 1, delay), delay);
        }
    }

    // ページ読み込み時にUIを試行
    window.addEventListener('load', () => {
        console.log('ページ読み込み完了。UI追加を試みます。');
        tryAddUI();
    });

    // ゲームの動的ロード対応
    setTimeout(() => {
        console.log('遅延UI追加を試みます。');
        tryAddUI();
    }, 10000);

    // 初回チェック（動的ロード対応）
    setTimeout(() => {
        console.log('初回タイトルチェックを実行');
        checkForText();
    }, 5000);

    // タイトル変更を監視
    const head = document.querySelector('head');
    if (head) {
        const observer = new MutationObserver(() => {
            checkForText();
        });
        observer.observe(head, {
            childList: true,
            subtree: true,
            characterData: true
        });
        window.addEventListener('unload', () => {
            stopSound();
            observer.disconnect();
        });
    } else {
        console.warn('head要素が見つかりません。タイトル監視に失敗。');
    }

    // 定期チェック（100ms間隔で高精度に）
    setInterval(checkForText, 100);
})();